import './popup.css'

function Popup(props) {
    switch (props.popupType) {
        case 'save':
            return (
                <div className={"popup savePopup"}>
                    <div id={"popupInfo"}>
                        <h1 id={"popupTitle"}>Save Reminders</h1>
                        <p id={"popupDescription"}>Would you like to save your reminders?</p>
                        <p id={"popupWarning"}>saving your reminders will clear your queue of undos and redos</p>
                    </div>
                    <div id={"popupActions"}>
                        <button className={"button"}>Cancel</button>
                        <button className={"important-button button"}>New Reminder</button>
                    </div>
                </div>
            );
        case 'confirmation':
            return (
                <div className={"popup confirmationPopup"}></div>
            );

        case 'error':
            return (
                <div className={"popup errorPopup"}></div>
            );
    }
}

export default Popup;
